import createStore from 'pure-store';
import * as params from './parameters.js';
import * as utils from './utils.js';

const store = createStore({
  shapes: {},
  toolpaths:[
    {
      type: "profile",
      name: "Profile 1",
      parameters: utils.deepcopy(params),
      geometry: utils.makeID(),
      id: utils.makeID(),
    },
    {
      type: "pocket",
      name: "Pocket 1",
      parameters: utils.deepcopy(params),
      geometry: utils.makeID(),
      id: utils.makeID(),
    }
  ],
  selected: [],
  material: "wood",
  thickness: 34,
  units: "mm",
  zero: "bottomleft",
  defaultParameters: utils.deepcopy(params), //need to generate these from material, thickness, units
});

export default store;
